import { Typography } from '@mui/material'
import React, { useState } from 'react'

function ApiTest() {
   const [data,setData]= useState('')
   fetch('https://tomestry.com/api/merchandise/').then((res)=>{return res.json()}).then((res)=>{return setData(res)})
  return (
    <div>{data.map((el)=>{return <Typography>{el}</Typography>})}</div>
  )
}

export default ApiTest
